import React from 'react';
import './Footer.css';

export default function Linkedin() {
  return (
    <footer className='footer justify-content-center' style={{marginTop: '100%'}}>
      <div className='container-fluid'>
        <div className='row'>
          <div className='col-12 text-center'>
            <p>Made by Paul Kirkpatrick</p>
          </div>
        </div>
      </div>
    </footer>
  );
}
